import { useParams, Link } from 'react-router-dom';

function PostsEdit() {
    const title = useParams();

    return (
      <div>
        <h2>Edit</h2>
        <Link to={`/posts/${title}/edit`}>Edit</Link>
      </div>
    )
}
  
export {PostsEdit};
